import React from "react";
import Card from "./Card";
import data from "../data.json";

function NewCard() {
    return(

        <div className="new-app">

            <nav>
                <button>One</button>
                <button>Two</button>
                <button>Three</button>
            </nav>

            <div>
                <Card />
                <Card />
                <Card />
            </div>
        </div>
    );
}

export default NewCard;
